import { FormControl } from 'react-bootstrap'
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'

function SubmissionForm(){

    const styles = StyleSheet.create({
        loginTextSection: {
           width: '100%',
           height: '30%',
        },

        loginButtonSection: {
           width: '100%',
           height: '30%',
           justifyContent: 'center',
           alignItems: 'center'
        },

        inputText: {
           marginLeft: '20%',
           width: '60%'
        },

        loginButton: {
          backgroundColor: 'blue',
          color: 'white'
        }
     })
    const submitForm = (e) => {
        e.preventDefault()
        const formData = new FormData(e.target)
        const payload = Object.fromEntries(formData)

        console.log(payload)
    }
    return (
        <form onSubmit={submitForm}>
        <Form.Group className='mb-3'>
            <Form.Label>First Label</Form.Label>
            <FormControl type="text" name="firstName" placeholder="Enter first name"></FormControl>
        </Form.Group>

        <Button style={styles.loginButtonSection} variant="primary" type="submit">
             Submit
        </Button>
      </form>
    )
}

export default SubmissionForm;
